Valdstein (Waldstein) ke tšenyeho seterekeng sa Semily haufi le Turnov, sebakeng sa Paradeise ea Bohemia. Ntlo ea matsoalloa ea Melimo ea Valdštejn e tsoa ho halofo ea bobeli ea 13. lekholo la lilemo. Ke e 'ngoe ea liqhobosheane tsa khale ka ho fetisisa sebakeng sena. Ntlo e hahile e 'ngoe ea makala a lelapa la Markvartic lilemong tsa 1260 ho 1280. E ne e ka etsahala hore ebe ho tloha Jaroslav Hruštice kapa mora oa hae Zdenek Wallenstein ebe o ile a bona ho lula ha lelapa, ho ea ka tseo ba le li
..........
). Lilemong tse 1438-1439 qhobosheaneng (le metsana e haufi le moo Kavčiny) tšoara likenke la masholu 'me ka hona bobeli ka 1440 hapa chelete la provense. beng tloswa tsoela pele. Ba ne ba lula mona Šofové tsa Helfenburk kaha 1514 Smiřičtí tsa Smiřic. Pota 1550 qhobosheaneng chesa fatše mollong. Qetellong ea 17. lekholong la lilemo la hermit lula lithakong tsa Vaclav Holan Rovenský qala mona le fumana baeti ba fapaneng. Beng ba ba sebakeng seo matlo Wallenstein (beng ba le lilemo 1620-1821) 'me
